window.bookSummaryJSON = "<p>Aeon and the Valthorns expand their reach to the neighboring worlds.<br> <br> They meet new people, new friends, new enemies, and encounter unusual races and creatures, and along the way, they accumulate more power, and build up their war potential.<br> <br> With their greater strength, it was finally time to slowly push back, and take the battle against the demons to the other realms, and also to the demon worlds.<br> <br> Book five of an epic reincarnation/isekai LitRPG story about a man who becomes a tree, growing and progressing throughout the ages in an eternal conflict against a demon incursion. With nearly 15 million views between Royal Road and ScribbleHub, this new and improved edition is sure to delight listeners!</p>"; 
